/// This class defines the interface for the tabulation of the cell
/// tensor corresponding to the local contribution to a form from
/// the integral over a cell.

class mixedpoissondual_cell_integral_1_otherwise: public ufc::cell_integral
{
public:

  /// Constructor
  mixedpoissondual_cell_integral_1_otherwise() : ufc::cell_integral()
  {
    // Do nothing
  }

  /// Destructor
  virtual ~mixedpoissondual_cell_integral_1_otherwise()
  {
    // Do nothing
  }

  /// Tabulate which form coefficients are used by this integral
  virtual const std::vector<bool> & enabled_coefficients() const
  {
    static const std::vector<bool> enabled({true, false});
    return enabled;
  }

  /// Tabulate the tensor for the contribution from a local cell
  virtual void tabulate_tensor(double*  A,
                               const double * const *  w,
                               const double*  vertex_coordinates,
                               int cell_orientation) const
  {
    // Number of operations (multiply-add pairs) for Jacobian data:      3
    // Number of operations (multiply-add pairs) for geometry tensor:    3
    // Number of operations (multiply-add pairs) for tensor contraction: 13
    // Total number of operations (multiply-add pairs):                  19
    
    // Compute Jacobian
    double J[4];
    compute_jacobian_triangle_2d(J, vertex_coordinates);
    
    // Compute Jacobian inverse and determinant
    double K[4];
    double detJ;
    compute_jacobian_inverse_triangle_2d(K, detJ, J);
    
    // Set scale factor
    const double det = std::abs(detJ);
    
    // Compute geometry tensor
    const double G0_0 = det*w[0][0]*(1.0);
    const double G0_1 = det*w[0][1]*(1.0);
    const double G0_2 = det*w[0][2]*(1.0);
    
    // Compute element tensor
    A[0] = 0.0;
    A[1] = 0.0;
    A[2] = 0.0;
    A[3] = 0.0;
    A[4] = 0.0;
    A[5] = 0.0;
    A[6] = 0.0;
    A[7] = 0.0;
    A[8] = -0.00833333333333326*G0_0 - 0.00416666666666664*G0_1 - 0.00416666666666665*G0_2;
    A[9] = -0.00416666666666666*G0_0 - 0.00833333333333342*G0_1 - 0.00416666666666669*G0_2;
    A[10] = -0.00416666666666666*G0_0 - 0.00416666666666668*G0_1 - 0.00833333333333341*G0_2;
    A[11] = -0.0375000000000002*G0_1;
    A[12] = -0.0375000000000001*G0_2;
    A[13] = -0.0375000000000001*G0_0;
    A[14] = -0.0374999999999999*G0_2;
    A[15] = -0.0375*G0_0;
    A[16] = -0.0374999999999999*G0_1;
    A[17] = -0.0749999999999998*G0_0 - 0.0749999999999998*G0_1 - 0.0749999999999997*G0_2;
  }

};

